import React from 'react'

const Notes = ({text, date}) =>{
    return(
       <div className="notes">
        <li className="note-item">
            <button className="deleteBtn">x</button> 
            <span className="date">{date}</span>
            <span className="text">{text}</span>
        </li>  
       </div>     
    );
}

export default Notes;
